import {
    Avatar,
    Button,
    Card, CardActions, CardContent, CardHeader, CardMedia,
    Dialog, DialogActions, DialogContent, DialogTitle, IconButton, Menu, MenuItem, Typography
} from '@material-ui/core';
import { red } from '@material-ui/core/colors';
import { createStyles, makeStyles, Theme } from '@material-ui/core/styles';
import { Delete, Edit } from '@material-ui/icons';
import FavoriteIcon from '@material-ui/icons/Favorite';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import { Post } from 'models';
import React, { useState } from 'react';
import moment from 'moment';

export interface PostItemProps {
    initialValue: Post
}

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      maxWidth: 345,
    },
    media: {
      height: 0,
      paddingTop: '56.25%', 
    },
    expand: {
      transform: 'rotate(0deg)',
      marginLeft: 'auto',
      transition: theme.transitions.create('transform', {
        duration: theme.transitions.duration.shortest,
      }),
    },
    expandOpen: {
      transform: 'rotate(180deg)',
    },
    avatar: {
      backgroundColor: red[500],
    },
    title: {
        cursor: 'pointer'
    },
  })
);

export default function PostItem({ initialValue }: PostItemProps) {
    const classes = useStyles();

    const [openPost, setOpenPost] = useState(false);

    const handleOpenPost = () => {
        setOpenPost(true);
    };

    const handleClosePost = () => {
        setOpenPost(false);
    };

    const [anchorEl, setAnchorEl] = useState<null | HTMLElement>(null);
    const openMenu = Boolean(anchorEl);
    

    const handleOpenMenu = (event: React.MouseEvent<HTMLElement>) => {
        setAnchorEl(event.currentTarget);
    };

    const handleCloseMenu = () => {
        setAnchorEl(null);
    };

    return (
        <Card className={classes.root}>
            <CardHeader
                avatar={
                    <Avatar aria-label="recipe" className={classes.avatar}>
                    R
                    </Avatar>
                }
                action={
                    <>
                        <IconButton 
                            aria-label="settings"
                            onClick={handleOpenMenu}
                        >
                            <MoreVertIcon />
                        </IconButton>
                        <Menu
                            id="menu-appbar"
                            anchorEl={anchorEl}
                            anchorOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            keepMounted
                            transformOrigin={{
                                vertical: 'top',
                                horizontal: 'right',
                            }}
                            open={openMenu}
                            onClose={handleCloseMenu}
                        >
                            <MenuItem onClick={handleCloseMenu}><Edit color="primary"/></MenuItem>
                            <MenuItem onClick={handleCloseMenu}><Delete color="secondary"/></MenuItem>
                        </Menu>
                    </>
                }
                title={getCu}
                subheader={moment(initialValue.createdAt).format('HH:MM MMM DD, YYYY')}
            />
            <CardMedia
                className={classes.media}
                image={initialValue.imageUrl}
                title="Paella dish"
            />
            <CardContent>
                <Typography className={classes.title} variant="body2" color="textSecondary" component="p" onClick={handleOpenPost}>
                    {initialValue.title}
                </Typography>
            </CardContent>
            <CardActions disableSpacing>
                <IconButton aria-label="add to favorites">
                    <FavoriteIcon color="secondary" /> 
                </IconButton>
                &nbsp; {initialValue.like}
            </CardActions>
                
            <Dialog
                open={openPost}
                onClose={handleClosePost}
                aria-labelledby="alert-dialog-title"
                aria-describedby="alert-dialog-description"
            >
                <DialogTitle id="alert-dialog-title">{initialValue.title}</DialogTitle>
                <DialogContent>
                    <CardContent>
                        <Typography paragraph>
                            {initialValue.content}
                        </Typography>
                    </CardContent>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClosePost} color="secondary" variant="contained">
                        Close
                    </Button>
                </DialogActions>
            </Dialog>
        </Card>
    );
}
